development was developed by Indra. However, the authorization and payment distribution I''m sure that it''s done in Class ConfirmOnHoldAction.java. Search HBFF mark or comment in the code of this class. Investigating further. attached is the email for detailed information. 1/10/2018 3:10:15 PM, NIIT.averma, Hi Team, Please check this incident and suggest. The 3EUR have been discount for each passenger (2ADT+1INF) so the total discount was 9EUR instead of 10EUR of the On-Hold fee payed by the customer. I seems that the problem is related to the infant that there aren�t on-hold fee for this kind of passenger but when is going for ticketing the infant is take as other passenger so the total On-Hold fee is share through the 3 passengers, so 10/3=3.33333 but only write 3 EUR without decimals in the FP, here is the problem. Probably this scenario haven�t been take into account in. Please check about this point and confirm this, maybe have to be a future enhancement. Regards, Anurag 1/9/2018 8:37:51 PM, NIIT.averma, We have checked the logs and the On-Hold amount of 10 EUR is already paid by the user. When user went to pay for the rest of 213.27 EUR then the payment was authorized but there was an error in the online emission so the tickets were generated offline : In FP there are multiple payment method this is why 3 EUR are shown. We are checking that what are these 3 EUR there in the FP.','MANTENIMIENTO IB.COM','INCIDENT','25/01/2018','SOFTWARE FAILURE','APPLICATION ERROR',27,'SIN IDENTIFICAR',NULL);
